import React from 'react';
import Box from '@material-ui/core/Box';
import '.score.css';

export const Score = ({ number}) => {

    const description = ({ number }) => {
        if (number > 750) {
            var high;
            return high
        }
        else if (number > 500) {
            var medium;
            return medium
        }
        else {
            var low;
            return low
        }
    }

    return (
        <Box fontFamily="fontFamily" m={2} className={`app-score--${description}`}>
            { number }
        </Box>
    );
}

export default Score;
